import styled from 'styled-components';

export const IntroContentWrapper = styled.div `
    position: relative;
    z-index: 10;
    top: 50%;
    transform: translateY(-50%);

    > * {
        text-align: left !important;
    }

    > svg {
        fill: #fff;
    }
`;
